export const fetchBasic =(setitems, setError) =>{
    fetch("http://localhost:5000/api/v1.0/test")
  .then(res => res.json()) // res == result
  .then(
    (result) => {
      setitems(
       result.items,
      );
      console.log("result",result)
    },
    (error) => {
      setError(
         true,
      )
    }
  )
}
